#The goal is to change the symbols of the DNA string by reverse complementing
#For example, GTCA will become TGAC
import sys

changes = {'A':'T','T':'A','C':'G','G':'C'}
string = ''

for i in range(len(string) -1, -1, -1):
    char = string[i]
    if char in changes:
        sys.stdout.write(changes[char])
